Task Requisition
---------------------------------------------------------------------------
Task Requisition is an abstract class. Both SurveillanceTask and PickUp&DeliveryTask are concrete implementations of Task.
TaskRequisition will reference a RobisepType and also, a user that requested the task. After approval, it will also reference a robisep.
Task State:
- Requested;
- Approved;
- Rejected;
- Planned:
